-- Création table


DROP TABLE IF EXISTS Commune CASCADE; 
CREATE TABLE Commune(
    code_commune VARCHAR(5) PRIMARY KEY,
    code_postal INT NOT NULL,
    libelle VARCHAR(100) NOT NULL,
    code_departement VARCHAR(3) NOT NULL
);

DROP TABLE IF EXISTS Type_contrat CASCADE; 
CREATE TABLE Type_contrat(
    code_contrat VARCHAR(3) PRIMARY KEY,
    libelle VARCHAR(100) NOT NULL
);

DROP TABLE IF EXISTS Secteur CASCADE; 
CREATE TABLE Secteur(
    code_naf VARCHAR(6) PRIMARY KEY,
    libelle VARCHAR(500) NOT NULL
);

DROP TABLE IF EXISTS Metier CASCADE; 
CREATE TABLE Metier(
    code_rome VARCHAR(5) PRIMARY KEY,
    libelle VARCHAR(200) NOT NULL
);


CREATE TABLE Offre(
    id_offre serial PRIMARY KEY,
    code_rome VARCHAR(5) DEFAULT NULL,
    code_naf VARCHAR(6) DEFAULT NULL,
    code_contrat VARCHAR(3) DEFAULT NULL,
    code_commune VARCHAR(5) DEFAULT NULL,
    intitule VARCHAR(500) DEFAULT NULL,
    nom_entreprise VARCHAR(1000) DEFAULT NULL,
    date_creation DATE DEFAULT NULL,
    salaire VARCHAR(1000) DEFAULT NULL,
    description_ VARCHAR(10000) DEFAULT NULL,
    CONSTRAINT FK_code_commune FOREIGN KEY (code_commune) REFERENCES Commune(code_commune), 
    CONSTRAINT FK_code_contrat FOREIGN KEY (code_contrat) REFERENCES Type_contrat(code_contrat), 
    CONSTRAINT FK_code_naf FOREIGN KEY (code_naf) REFERENCES Secteur(code_naf),
    CONSTRAINT FK_code_rome FOREIGN KEY (code_rome) REFERENCES Metier(code_rome) 
);








